function not_empty( input ) {
    
    if ( input.length !== 0 ) {
        
        return true;
    }
    
    return false;
}


function display_media() {
    var images = [
        'data:image/jpeg;base64,',
        'data:image/jpeg;base64,',
        'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQ6BPzITc7T9qnvmTb0Ak-WrDLnpmk1Hc6oGa5CriARVp4hquon',
        'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTlndIxHFsVezyfi3OX-JBtGmi6T4MF6agMvN27VKDMD5FUp0d6VA',
        'http://viajandopelaflorida.com.br/wp-content/uploads/2016/09/12224631_902743656447305_1740744695_n.jpg'
    ]
    
    for ( var k in images ) {
        
        $('.media_container').append('<img style="margin: 20px;" class="col-xs-4 col-sm-4 col-md-4 img-responsive img-thumbnail" src="'+ images[k] +'" />');
    }
}


$(document).ready(function() {
    
    display_media();
    
    $('#sign_up').click(function() {
        if ( not_empty( $('#email').val() ) && not_empty( $('#name').val() ) ) {
        
            $('#myModal').modal('show');
            $('#myModal').find('#text').html('HI - <span style="color: gray">'+ $('#name').val() +'</span> thank you for signing up! We will send an email to <span style="color: gray">'+ $('#email').val() +'</span> shortly')
        }
    })

    $(".social_media").hover(function() {
        $("style").css("background-color", "blue");
    })


    $('.carousel').carousel({
        interval: 2000
        
    })
    
    $('.social_media img').mouseenter(function() {
        
        $(this).animate({
            height: '+=50'
        }, 'slow')
    })
    
    $('.social_media img').mouseleave(function() {
        
        $(this).animate({
            height: '-=50'
        }, 'slow')
    })
    
    
});
